import React, { Component } from 'react'

class BeepBoop extends Component {
    constructor(props) {
        super(props)

        this.state = {
             isBeeping: false
        }
    }

    render() {
        if(this.state.isBeeping)
        {
            return (
                <div>
                  <h1>Beep</h1>
                </div>
            )
        }
        else
        {
            return (
                <div>
                    <h1>Boop</h1>
                </div>
            )

        }

    }
}

export default BeepBoop
